import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import LandPage from './component/landingPage/LandPage';
import SignIn from './component/signin/SignIn';



function App() {
  return (
    <div className="App">


      <BrowserRouter>
        <Routes>
          <Route path='/' element={<SignIn/>} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
